import sys

data = sys.stdin.read().strip().split()
if not data:
    sys.exit(0)
it = iter(data)
out_lines = []
while True:
    try:
        R = int(next(it))
        B = int(next(it))
    except StopIteration:
        break
    # skip coordinates
    for _ in range(R + B):
        try:
            next(it); next(it)
        except StopIteration:
            break
    out_lines.append("Yes" if R == B else "No")

print("\n".join(out_lines))

